import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Arrowr from "@material-ui/icons/Input";

import styles from "assets/jss/material-kit-react/views/componentsSections/newsStyle.js";

import rudrawin from "assets/img/image/news/irc-prize.webp";
import Bgvideo from "assets/videos/warrovervidf.mp4";

const useStyles = makeStyles(styles);

export default function SectionNews() {
    const classes = useStyles();

    return(<div>
        <div className={classes.container}>
            <h1 className={classes.title}>
                NEWS
            </h1>
            <video autoPlay loop muted className={classes.video}>
                <source src={Bgvideo} type="video/mp4" />
            </video>
            <div className={classes.section1}>
                <img src={rudrawin} width='100%' height='100%' />
            </div>   
        </div>
    </div>
    );
}
